import axios from "axios";
import React from "react";
import { useParams } from "react-router";

function NextQuestion() {
  const [questions, setQuestions] = React.useState(null);
  const [nextQuestion, setNextQuestion] = React.useState(null);
  const history = useParams();
  history.go(0);

  React.useEffect(() => {
    axios.get(`${process.env.REACT_APP_API_URL}/questions`).then((response) => {
      setQuestions(response.data);
    });
  }, []);

  React.useEffect(() => {
    axios
      .get(`${process.env.REACT_APP_API_URL}/next_questions`)
      .then((response) => {
        setNextQuestion(response.data);
      });
  }, []);

  function updateNextQuestion(id) {
    axios
      .put(`${process.env.REACT_APP_API_URL}/next_questions/1`, {
        number: id,
      })
      .then((response) => {
        setNextQuestion(response.data);
        window.location.reload(`http://localhost:3008/user`);
      });
  }

  if (!questions) return null;
  return (
    <table className="one">
      {questions.map((question) => {
        return (
          <td>
            <button onClick={() => updateNextQuestion(question.id)}>
              {question.title}
            </button>
          </td>
        );
      })}
    </table>
  );
}

export default NextQuestion;
